import { useEffect, useCookies } from "react";
import _ from "lodash";

function Home() {
    const user = sessionStorage.getItem("userinfo");
    const [cookies, ,removeCookies] = useCookies("user");
    console.log(cookies);
    console.log(cookies.user);

    useEffect(() => {
        if(_.isEmpty(user)){
            try{
                if(!_.isEmpty(cookies.user)){
                    sessionStorage.setItem("userinfo", cookies.user);
                    removeCookies("user");
                }
            }catch(e){
                console.log(e);
            }
        }
    }, [user, cookies.user, removeCookies])

    useEffect(() => {
        alert("App_Board 테스트 홈페이지입니다.");
    }, []);

    return(
        <div style={{marginTop: "100px", textAlign: "center"}}>
            <b style={{ fontSize: "40px"}}> Home Page </b>
            <p> 
                App_Board Tutorial <br/>
                Java Spring boot / React.js / MySQL Workbench
            </p>
        </div>
    );
};

export default Home;
